export default function Experince()
{
    return <>
        <mesh rotation-y={ Math.PI * 0.25 } position-x={ 2 } scale={ 0.05 }>
            <boxGeometry scale={ 0.05 }/>
            <meshBasicMaterial color="mediumpurple" wireframe={ true }/>
        </mesh>
    </>
}
